// ContactUs.js

import React, { useState } from 'react';
import { Container, Row, Col, Form, Button, Card } from 'react-bootstrap';

const ContactUs = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert('Form submitted');
   
    setFormData({ name: '', email: '', message: '' }); 

  return (
    <Container className="mt-4">
      <Row>
        <Col md={12}>
          <h2 className="text-center mb-4">Contact Us</h2>
          <Card>
            <Card.Body>
              <Card.Title>We'd Love to Hear from You</Card.Title>
              <Card.Text>
                Whether you have questions, feedback, or just want to get in touch, feel free to reach out.
                Our team is happy to assist you with anything you need.
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      </Row>

      <Row className="mt-4">
        <Col md={6}>
          <h4>Contact Information</h4>
          <Card>
            <Card.Body>
              <Card.Title>Head Office</Card.Title>
              <Card.Text>
                <strong>HDSI Foundation</strong>
                <br />
                Address: 1234 Example Road, City, State, 56789
                <br />
                Phone: +1 234 567 890
                <br />
                Email: contact@HDSIfoundation.org
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>

        <Col md={6}>
          <h4>Send Us a Message</h4>
          <Form onSubmit={handleSubmit}>
            <Form.Group controlId="formName" className="mb-3">
              <Form.Label>Name</Form.Label>
              <Form.Control
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                placeholder="Enter your name"
                required
              />
            </Form.Group>

            <Form.Group controlId="formEmail" className="mb-3">
              <Form.Label>Email address</Form.Label>
              <Form.Control
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                placeholder="Enter your email"
                required
              />
            </Form.Group>

            <Form.Group controlId="formMessage" className="mb-3">
              <Form.Label>Message</Form.Label>
              <Form.Control
                as="textarea"
                rows={4}
                name="message"
                value={formData.message}
                onChange={handleChange}
                placeholder="Your message"
                required
              />
            </Form.Group>

            <Button variant="primary" type="submit">
              Submit
            </Button>
          </Form>
        </Col>
      </Row>
    </Container>
  );
}
};

export default ContactUs;
